window.bookSummaryJSON = "<p><b>She was willing to sacrifice anything for revenge. But she thought she was only gambling with her life… not her heart.</b></p> <p>Aerial performer Zita has dedicated ten years of her life to one thing and one thing alone: vengeance. Armed with an iron blade, she must take to the silks and give the performance of a lifetime to kill the notorious Prince of Monsters—the fae prince responsible for her sister's death.</p> <p>But when Zita's plan fails, she finds herself imprisoned and sentenced to be the prince's \"pet\" as punishment for her crime. With cruelty as sharp as his claws, Sepher is everything Zita expected from her enemy. Yet he's also patient and obsessive, particularly when it comes to his \"pet's\" punishment.</p> <p>Nevertheless, Zita refuses to surrender—not even to a fae prince. Sepher may have collared her, but nothing can stop her from getting her revenge… not even at the cost of her heart.</p> <p>Full of claws, curses, and a deadly game of cat and mouse, this twisted reimagining of <i>Beauty and the Beast</i> is perfect for fans of <i>A Court of Thorns and Roses</i> and <i>The Cruel Prince</i>.</p> <p><i>Slaying the Shifter Prince </i>is a standalone installment of the heart-pounding fantasy romance series Mortal Enemies to Monster Lovers. If you like villains who get the girl, enemies-to-lovers, morally grey characters, and touch-her-and-die vibes, you'll devour this sexy, addictive series.</p>"; 
